const SearchMovie = () => {


  const [text,setText]=useState("")
  return (
    <div>
      <div className="search-container">

      <input
      type="text"
      placeholder="name of movie ?"
      value={text}
      onChange={e=>setText(e.target.value)}
      />
      
     
        <div className="rating-search">

         
        </div>
      </div>
    </div>
  );
};

export default SearchMovie;
